    "2015-02-04T19:39:01.813811",nt"name": "chicago-police-department-illinois-uniform-crime-reporting-iucr-codes-660e4",nt"isopen":
    false,nt"url": null,nt"notes": "Illinois Uniform Crime Reporting (IUCR)
    codes are four digit codes that law enforcement agencies use to classify criminal
    incidents when taking individual reports. These codes are also used to aggregate
    types of cases for statistical purposes.  In Illinois, the Illinois State Police
    establish IUCR codes, but the agencies can add codes to suit their individual needs.
     The Chicago Police Department currently uses more than 350 IUCR codes to classify
    criminal offenses, divided into u201cIndexu201d and u201cNon-Indexu201d offenses.
     Index offenses are the offenses that are collected nation-wide by the Federal
    Bureaus of Investigationu2019s Uniform Crime Reports program to document crime trends
    over time (data released semi-annually), and include murder, criminal sexual assault,
    robbery, aggravated assault & battery, burglary, theft, motor vehicle theft, and
    arson.  Non-index offenses are all other types of criminal incidents, including
    vandalism, weapons violations, public peace violations, etc.",nt"license_title":
